    <div className="tabs">
      <div className="tab active-tab" onClick={() => onChangeTab('formulario')}>Formulário</div>
      <div className="tab" onClick={() => onChangeTab('mapa')}>Mapa</div>
      <div className="tab" onClick={() => onChangeTab('relatorio')}>Relatório</div>
    </div>
  );
  
  export default Tabs;
